import React, { useState } from 'react'
import"../UI/UserView.css"
function UserView() {
    const [count,setCount]=useState(0)
   const displayCount=()=>{
            setCount(1)
   }
  return (
      <div className="parent">
          <div><h1>Tik-Tac-Toe</h1></div>
    <div className='main-comp'>
        <div className="sub-comp" onClick={displayCount}>
            {count}
        </div>
        <div className="sub-comp">
        {count}
        </div>
        <div className="sub-comp">
        {`<h1>{count}</h1>`}
        </div>
        <div className="sub-comp">
        {count}
        </div>
        <div className="sub-comp">
        {count}
        </div>
        <div className="sub-comp">
        {count}
        </div>
        <div className="sub-comp">
        {count}
        </div>
        <div className="sub-comp">
        {count}
        </div>
        <div className="sub-comp">
        {count}
        </div>
    </div>
    </div>
  )
}

export default UserView
